(10807, '023CFF1C-77C4-41FB-B918-0AF3AA7C7B46', 'Shall I buy us tickets for Vegas? We can do it when you get home.', 'Nitzan', 'David', '2018-03-28T14:50:12'),
(10808, 'B03B2FC1-1B25-43F6-9B61-3EAD1FAB2EB5', 'Sarah is going to request the 3 month severance from the board. They suggested to her it would be 6-8 weeks. She is also going to recommend giving me $1 per student for the open contracts - asu, etc.', 'Nitzan', 'David', '2018-03-28T14:51:44'),
(10809, '9ED05707-B056-4EE1-B9DD-18D99BB789C1', 'We''ll see whether the board agrees but I appreciate that she is being generous ', 'Nitzan', 'David', '2018-03-28T14:52:04'),
(10810, '70F12A78-7C8D-447A-B1EE-DB7913EC8A33', 'I cried a lot to her and Paul today after the asu contract confirmation came in', 'Nitzan', 'David', '2018-03-28T14:52:22'),
(10814, '39246B90-88D2-4D82-9010-5FA19656F638', 'I think you may want to lobby hard with paul/Allison for the 3 months and if the board authorized  only  two, that the 3rd month comes from entangled....they said they would help you through this transition and 2 months is absolutely nothing. I’d like to see us have health coverage paid for through June, if nothing else, which would mean they keep you on payroll until June 1st at least. Also, what is the deal with your equity and vesting? You aren’t fully vested yet. So what equity do you keep? Is it in your agreement? This might also be something you need to negotiate(?)', 'David', 'Nitzan', '2018-03-28T15:22:48'),
(10819, '695CC4FD-21AB-4594-9F30-B495E55B9FA0', 'I asked Paul for me to be vested at 3 years. ', 'Nitzan', 'David', '2018-03-28T15:25:44'),
(10820, 'D2BDC744-2E84-460E-97C6-769A2456DFB8', 'I will push hard for the 3 months ', 'Nitzan', 'David', '2018-03-28T15:26:07'),
(10821, 'BD6D78EC-B036-4476-A920-2C8B81D34668', 'It may be that they do that as severance instead of being on payroll for legal purposes ', 'Nitzan', 'David', '2018-03-28T15:26:23'),
(10822, '85F6FFB7-9D68-4607-8F54-A053E3CFFD92', 'If I''m not working more than 20 hours a week, I don''t think they can allow me to stay on payroll ', 'Nitzan', 'David', '2018-03-28T15:26:54'),
(10823, 'E31668D0-6B73-4105-955C-08A392C71AE5', 'Are you fully vested in 4 yrs? 3 yrs sounds right. They should cover the extra health insurance premiums for May and June and make sure the termination date is not before April 1.', 'David', 'Nitzan', '2018-03-28T15:36:07'),
(10825, '23AB3852-4A5C-4A58-88F9-5A0F4EA12334', 'The last day will be Monday which is April 2nd so we''ll definitely have health insurance for April.', 'Nitzan', 'David', '2018-03-28T15:44:23'),
(10832, 'B34D3D01-A460-413A-B11A-F6AD1996AF9D', 'A silver lining thought on the “heartbreaking” comment above. It is heartbreaking and awesome. You are leaving having saved the company and put it on a path for potential growth. You’ve put in place the leadership that can (hopefully) figure out the next stage. I could argue...and we can look back in 3 yrs and see how it pans out...that you’ve already made the biggest impact that you are best suited to make....many more thousands of students will go back to school because of you..whether you are at ReUp or not... Most likely you will have a bigger impact by finding another idea or another opportunity and apply your super power to getting it off the ground and on a growth path. You dont know which ones are going to work out or stick, so doing more of them will increase your hit rate (and impact). Not many people can do what you have done...so take all the learnings you’ve had, and when you are ready....apply them to what is next. I don’t want to minimize how sucky and painful and sad this is for you. And in my recent life experience...the most painful sucky events opened me up to growth and a new path I could have never imagined....a life together with you (and our wonder-family!) I love you so much and am here in every possible way to work through the hard stuff.  ', 'David', 'Nitzan', '2018-03-28T17:47:08'),
(10833, '6E0AE5EC-4A1B-4714-A306-B5220759AA21', ' Babe. I''m so so so incredibly lucky to have you. Thank you for this note and for being the perfect husband through this amazingly difficult time. ', 'Nitzan', 'David', '2018-03-28T20:20:03'),
