(11515, '764C5347-B9B0-4D45-90FD-70834BEBE0F9', 'Love. Just wanted to say how grateful I am for all the support and love you''ve shown over the last two weeks. I literally have no idea how I would have survived without you. You have engaged with empathy and problem solving - both of which I appreciate deeply.  ', 'Nitzan', 'David', '2018-04-15T17:49:45'),
